import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import ProductList from './components/ProductList';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <main className="main-content">
          <Routes>
            <Route path="/" element={<h1>Bienvenido a 3D Store</h1>} />
            <Route path="/productos" element={<ProductList />} />
            <Route path="/categorias" element={<h1>Categorías (Próximamente)</h1>} />
            <Route path="/usuarios" element={<h1>Usuarios (Próximamente)</h1>} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
